s'=>'Załącz obrazki','CDN URL to be used. For example, %s'=>'Adres CDN do użycia. Przykład, %s','CDN URL'=>'CDN URL','Site URL to be served through the CDN. Beginning with %1$s. For example, %2$s.'=>'Adres używany przez CDN, Zaczynający się od %1$s. przykład: %2$s','Original URLs'=>'Oryginalne URL','CDN Settings'=>'Ustawienia CDN','CDN'=>'CDN','OFF'=>'Wyłącz','ON'=>'Wł','Notified LiteSpeed Web Server to purge CSS/JS entries.'=>'Powiadomiono LiteSpeed aby wyczyścił wpisy CSS/JS.','Minify HTML content.'=>'Minifikacja zawartości HTML.','HTML Minify'=>'HTML Minify','JS Excludes'=>'Wykluczenia JS','JS Combine'=>'Połącz JS','JS Minify'=>'JS Minify','CSS Excludes'=>'Wykluczenia CSS','CSS Combine'=>'Połączenie CSS','CSS Minify'=>'CSS Minify','Please test thoroughly when enabling any option in this list. After changing Minify/Combine settings, please do a Purge All action.'=>'Prosimy o dokładne sprawdzenie podczas włączania dowolnej opcji na tej liście. Po zmianie ustawień Minify / Combine należy wykonać operację Wyczyść wszystko.','This will purge all minified/combined CSS/JS entries only'=>'Spowoduje to oczyszczenie wszystkich minifikowanych / połączonych wpisów CSS / JS','Purge %s Error'=>'Wyczyść błąd %s','Database Optimizer'=>'Optymalizator bazy danych','Optimize all tables in your database'=>'Optymalizuje wszystkie tabele w twojej bazie danych','Optimize Tables'=>'Optymalizuj tabele','Clean all transient options'=>'Wyczyść wszystkie dane tymczasowe','All Transients'=>'Wszystkie dane tymczasowe','Clean expired transient options'=>'Wyczyść wszystkie zakończone dane tymczasowe','Expired Transients'=>'Zakończone dane tymczasowe','Clean all trackbacks and pingbacks'=>'Wyczyść wszystkie Trackback\'i i pingback\'i.','Trackbacks/Pingbacks'=>'Trackbacki/Pingbacki','Clean all trashed comments'=>'Wyczyść wszystkie komentarze w koszu','Trashed Comments'=>'Komentarze w koszu','Clean all spam comments'=>'Wyczyść wszystkie komentarze spam','Spam Comments'=>'Komentarze zawierające spam','Clean all trashed posts and pages'=>'Wyczyść wszystkie usunięte posty i strony','Trashed Posts'=>'Usunięte posty','Clean all auto saved drafts'=>'Wyczyść wszystkie automatycznie zapisane wersje robocze','Auto Drafts'=>'Automatyczne wersje robocze','Clean all post revisions'=>'Wyczyść wszystkie rewizje postów','Post Revisions'=>'Wersje wpisu','Clean All'=>'Wyczyść wszystko','Optimized all tables.'=>'Zoptymalizowano wszystkie tabele.','Clean all transients successfully.'=>'Wyczyszczono wszystkie dane tymczasowe.','Clean expired transients successfully.'=>'Wyczyszczono wszystkie zakończone dane tymczasowe.','Clean trackbacks and pingbacks successfully.'=>'Wyczyszczono wszystkie trackback\'i i pingback\'i.','Clean trashed comments successfully.'=>'Wyczyszczono wszystkie usunięte komentarze.','Clean spam comments successfully.'=>'Wyczyszczono wszystkie spamerskie komentarze.','Clean trashed posts and pages successfully.'=>'Wyczyszczono wszystkie usunięte strony i posty.','Clean auto drafts successfully.'=>'Wyczyszczono wszystkie automatyczne wersje robocze.','Clean post revisions successfully.'=>'Wyczyszczono wszystkie rewizje.','Clean all successfully.'=>'Wyczyszczono wszystko.','Default Private Cache TTL'=>'Domyślny TTL prywatnej pamięci podręcznej','If your site contains public content that certain user roles can see but other roles cannot, you can specify a Vary Group for those user roles. For example, specifying an administrator vary group allows there to be a separate publicly-cached page tailored to administrators (with “edit” links, etc), while all other user roles see the default public page.'=>'Jeśli witryna zawiera treść publiczną, którą konkretne grupy mogą zobaczyć, ale inne grupy nie mogą, można określić grupę zmienną dla tych ról użytkownika. Na przykład określenie grupy odmiennej dla administratora pozwala na oddzielną stronę publiczną zapisaną w pamięci podręcznej, dostosowaną do administratorów (z liniami "edytuj" itp.), Podczas gdy wszystkie inne role użytkowników mają domyślną stronę publiczną.','Vary Group'=>'Grupa zmienna','Cache the built-in Comment Form ESI block.'=>'Zapisz w pamięci podręcznej wbudowany blok ESI Comment Form.','Cache Comment Form'=>'Zapisz formularz komentarzy',' Cache the built-in Admin Bar ESI block.'=>'Zapisz w pamięci podręcznej wbudowany blok Admin Bar ESI.','Cache Admin Bar'=>'Zapisuj pasek administratora','Turn ON to cache public pages for logged in users, and serve the Admin Bar and Comment Form via ESI blocks. These two blocks will be uncached unless enabled below.'=>'Włączenie buforowania publicznych stron dla zalogowanych użytkowników oraz obsługa paska administratora i formularza komentarza za pomocą bloków ESI. Te dwa bloki zostaną odłączone, chyba że zostanie to włączone poniżej.','ESI allows you to designate parts of your dynamic page as separate fragments that are then assembled together to make the whole page. In other words, ESI lets you “punch holes” in a page, and then fill those holes with content that may be cached privately, cached publicly with its own TTL, or not cached at all.'=>'ESI umożliwia określenie części strony dynamicznej jako oddzielnych fragmentów, które są następnie montowane razem w celu utworzenia całej strony. Innymi słowy, ESI umożliwia "łatanie dziur" na stronie, a następnie wypełnienie tych luk treścią, która może być przechowywana w prywatnych, buforowanych publicznie z własnym TTL lub bez pamięci podręcznej.','With ESI (Edge Side Includes), pages may be served from cache for logged-in users.'=>'W przypadku ESI (Edge Side Includes) strony mogą być wyświetlane z pamięci podręcznej dla zalogowanych użytkowników.','Private'=>'Prywatny','Public'=>'Publiczne','Purge Settings'=>'Wyczyść ustawienia','Cache PHP Resources'=>'Zapisz zasoby PHP','Cache Mobile'=>'Zapisuj urządzenia mobilne','Advanced level will log more details.'=>'Poziom zaawansowany będzie rejestrował więcej szczegółów.','Basic'=>'Podstawowe','The maximum average server load allowed while crawling. The number of crawler threads in use will be actively reduced until average server load falls under this limit. If this cannot be achieved with a single thread, the current crawler run will be terminated.'=>'Maksymalne dozwolone obciążenie serwera podczas indeksowania. Liczba wątków robota przeszukiwacza będzie aktywnie zmniejszana do czasu, gdy średni poziom obciążenia serwera spadnie poniżej tego limitu. Jeśli nie można tego osiągnąć jednym pojedynczym wątkiem, bieżący robot indeksujący zostanie zakończony.','Cache Login Page'=>'Zapisuj stronę logowanie do pamięci podręcznej','Cache requests made by WordPress REST API calls.'=>'Żądania dotyczące pamięci podręcznej wywołane przez wywołania API WordPressa REST.','Cache REST API'=>'Zapisuj REST API do pamięci podręcznej','Privately cache commenters that have pending comments. Disabling this option will serve non-cacheable pages to commenters. (LSWS %s required)'=>'Prywatnie zapisuj komentarze, które oczekują na komentarze. Wyłączenie tej opcji spowoduje, że komentarze będą obsługiwane stronom, które nie są buforowane. (Wymaga LSWS %s)','Cache Commenters'=>'Zapisuj komentujących w pamięci podręcznej','Privately cache frontend pages for logged-in users. (LSWS %s required)'=>'Prywatnie zapisuj strony front-endu dla zalogowanych użytkowników. (LSWS %s wymagany)','Cache Logged-in Users'=>'Zapisuj w pamięci podręcznej dla zalogowanych użytkowników','Cache Control Settings'=>'Ustawienia kontroli pamięci podręcznej','ESI'=>'ESI','Excludes'=>'Nie zawiera','Purge'=>'Wyczyść','Cache'=>'Pamięć podręczna','WooCommerce'=>'WooCommerce','Unexpected cache rule %2$s found in %1$s file. This rule may cause visitors to see old versions of pages due to the browser caching HTML pages. If you are sure that HTML pages are not being browser cached, this message can be dismissed. (<a %3$s>Learn More</a>)'=>'Niespodziewana reguła cache %2$s znaleziona w pliku %1$s. Reguła ta może spowodować, że odwiedzający zobaczą stare wersje stron z powodu buforowania stron HTML przez przeglądarkę. Jeśli jesteś pewien, że strony HTML nie są buforowane przez przeglądarkę, ten komunikat może zostać odrzucony. (<a %3$s>Learn More</a>)','Current server time is %s.'=>'Aktualny czas serwera to %s.','Specify the time to purge the "%s" list.'=>'Wpisz czas do usunięcia listy "%s" ','Both %1$s and %2$s are acceptable.'=>'Obydwie %1$s i %2$s są przyjmowane.','Scheduled Purge Time'=>'Zaplanowany czas czyszczenia','The URLs here (one per line) will be purged automatically at the time set in the option "%s".'=>'Adresy URL (jedna na linię) zostaną automatycznie usunięte w czasie ustawionym w opcji "%s".','Scheduled Purge URLs'=>'Zaplanowane adresy URL','Shorten query strings in the debug log to improve readability.'=>'Skróć łańcuchy zapytań w dzienniku debugowania w celu zwiększenia czytelności.','Log requested cookie values.'=>'Loguj żądane wartości plików cookie.','Heartbeat'=>'Heartbeat','MB'=>'MB','Log File Size Limit'=>'Loguj limit rozmiaru plików','<p>Please add/replace the following codes into the beginning of %1$s:</p> %2$s'=>'<p> Proszę dodać / zastąpić następujące kody na początku %1$s: </p> %2$s','%s file not writable.'=>'plik %s nie jest zapisywalny.','%s file not readable.'=>'Plik %s nie nadaje się do odczytu.','Collapse Query Strings'=>'Zwiń Query Strings','Log Cookies'=>'Loguj ciasteczka','ESI Settings'=>'Ustawienia ESI','A TTL of 0 indicates do not cache.'=>'Ustawienie TTL na 0 wyłącza zapisywanie do pamięci podręcznej.','Recommended value: 28800 seconds (8 hours).'=>'Zalecana wartość: 28800 sekund (8 godzin).','Widget Cache TTL:'=>'Pamięć podręczna TTL widgetów:','Enable ESI'=>'Włącz ESI','See <a %s>Introduction for Enabling the Crawler</a> for detailed information.'=>'Zajrzyj do <a %s>poradnika uruchomienia robota</a> aby uzyskać więcej informacji.','Custom Sitemap'=>'Niestandardowa mapa strony','Purge pages by relative or full URL.'=>'Usuwanie stron według względnego lub pełnego adresu URL.','WARNING'=>'OSTRZEŻENIE','<b>Last crawled:</b> %s item(s)'=>'<b>Ostatnio zindeksowano:</b> %s rzeczy','The next complete sitemap crawl will start at'=>'Następne kompletne indeksowanie mapy witryny rozpocznie się za','Failed to write to %s.'=>'Błąd zapisu do %s.','Folder is not writable: %s.'=>'Folder nie jest zapisywalny: %s.','Can not create folder: %1$s. Error: %2$s'=>'Nie mogę utworzyć folderu: %1$s. Błąd: %2$s','Folder does not exist: %s'=>'Folder: %s nie istnieje','Notified LiteSpeed Web Server to purge the list.'=>'Poinformowano Serwer LiteSpeed o usunięciu listy.','Please visit the <a %s>Information</a> page on how to test the cache.'=>'Odwiedź stronę <a %s>informacje</a> aby dowiedzieć się jak przetestować pamięć podręczną.','Allows listed IPs (one per line) to perform certain actions from their browsers.'=>'Pozwala adresom IP na liście (jednym w linii) na pewnie akcje z ich przeglądarek.','Server Load Limit'=>'Limit obciążenia serwera','Specify Number of Threads to use while crawling.'=>'Wpisz liczbę wątków do użytku podczas indeksowania.','Specify how long in seconds before the crawler should initiate crawling the entire sitemap again.'=>'Wpisz jak długo w sekundach robot indeksujący powinien inicjować ponowne indeksowanie całej mapy strony.','Crawl Interval'=>'Interwał robota indeksującego','Interval Between Runs'=>'Interwał między uruchomieniami','Specify time in seconds for the duration of the crawl interval.'=>'Określ czas w sekundach na czas trwania indeksowania.','Specify time in microseconds for the delay between requests during a crawl.'=>'Określ czas w milisekundach czasu opóźnienia między żądaniami podczas indeksowania.','microseconds'=>'Milisekundy','Then another WordPress is installed (NOT MULTISITE) at %s'=>'Inna instancja WordPressa jest zainstalowana (NIE MULTISTRONA) jest w %s','LiteSpeed Cache Network Cache Settings'=>'Ustawienia sieciowej pamięci podręcznej LiteSpeed Cache','Select below for "Purge by" options.'=>'Wybierz poniżej opcję "Wyczyść przez".','LiteSpeed Cache CDN'=>'LiteSpeed Cache CDN','No crawler meta file generated yet'=>'Nie wygenerowano jeszcze pliku meta dla robota indeksującego.','Show crawler status'=>'Wyświetl stan robota','Watch Crawler Status'=>'Zobacz status robota ideksującego','Please see <a %s>Hooking WP-Cron Into the System Task Scheduler</a> to learn how to create the system cron task.'=>'Zajrzyj do <a %s>Podłączanie WP-Crona do harmonogramu zadań systemowych </a>, aby utworzyć zadanie systemu cron.','Run frequency is set by the Interval Between Runs setting.'=>'Częstotliwość uruchamiania jest ustawiana przez ustawienie Interwał między uruchomieniami.','Manually run'=>'Ręczne uruchomienie','Reset position'=>'Zresetuj pozycję','Run Frequency'=>'Częstotliwość uruchamiania','Cron Name'=>'Nazwa cron','Crawler Cron'=>'Cron robota indeksującego','%d minute'=>'%d minuta','%d minutes'=>'%d minut','%d hour'=>'%d godzina','%d hours'=>'%d godzin','Generated at %s'=>'Wygenerowano %s','LiteSpeed Cache Crawler'=>'Robot indeksujący LiteSpeed Cache','Threads'=>'Wątki','Run Duration'=>'Czas uruchomienia','Delay'=>'Opóźnienie','If there are any questions, the team is always happy to answer any questions on the <a %s>support forum</a>.'=>'Jeśli masz jakiekolwiek pytania, to nasz zespół chętnie ci udzieli odpowiedzi na <a %s>forum</a>.','Crawler'=>'Robot indeksujący','https://www.litespeedtech.com/products/cache-plugins/wordpress-acceleration'=>'https://www.litespeedtech.com/products/cache-plugins/wordpress-acceleration','All pages with Recent Posts Widget'=>'Wszystkie strony z widgetem Ostatnie posty','Pages'=>'Strony','This will Purge Pages only'=>'To wyczyści tylko strony','Purge Pages'=>'Wyczyść strony','Email Address'=>'Adres e-mail','Install Now'=>'Zainstaluj','Purged the url!'=>'Wyczyszczono ten adres URL!','Purged the blog!'=>'Wyczyszczono ten blog!','Purged All!'=>'Wyczyszczono wszystko!','Notified LiteSpeed Web Server to purge error pages.'=>'Powiadomiono LiteSpeed Web Server o usunięciu stron błędów.','If using OpenLiteSpeed, the server must be restarted once for the changes to take effect.'=>'Jeśli używasz OpenLiteSpeed, musisz go zrestartować aby zmiany odniosły efekt.','If not, please verify the setting in the <a href="%1$s">Advanced tab</a>.'=>'Jeśli nie, zweryfikuj ustawienia w zakładce <a href="%1$s">zaawansowane</a>.','If the login cookie was recently changed in the settings, please log out and back in.'=>'Jeśli plik cookie logowania został ostatnio zmieniony w ustawieniach, wyloguj się i zaloguj.','However, there is no way of knowing all the possible customizations that were implemented.'=>'Jednak nie ma możliwości poznania wszystkich możliwych dostosowań, które zostały wdrożone.','The LiteSpeed Cache plugin is used to cache pages - a simple way to improve the performance of the site.'=>'Wtyczka  LiteSpeed Cache jest używania do zapisywania stron w pamięci podręcznej -  prosty sposób na przyspieszenie twojej strony.','The network admin setting can be overridden here.'=>'Możesz tutaj nadpisać ustawienia administratora sieci.','Specify how long, in seconds, public pages are cached.'=>'Określ, jak długo, w sekundach, publiczne strony będą przechowywane w pamięci podręcznej.','Specify how long, in seconds, private pages are cached.'=>'Określ, jak długo, w sekundach, prywatne strony będą przechowywane w pamięci podręcznej.','It is <b>STRONGLY</b> recommend that the compatibility with other plugins on a single/few sites is tested first.'=>'<b>ZALECA SIĘ</b>  sprawdzić kompatybilność z innymi wtyczkami na jeden lub kilku stronach.','Purge pages by post ID.'=>'Wyczyść strony używając ID postów.','Purge the LiteSpeed cache entries created by this plugin'=>'Usuń wpisy pamięci podręcznej Litespeed utworzone przez tę wtyczkę','This will Purge Front Page only'=>'To wyczyści tylko stronę główną.','Purge pages by tag name - e.g. %2$s should be used for the URL %1$s.'=>'Wyczyść strony używając tagów - e.g. %2$s powinno zostać użyte dla adresu %1$s.','e.g. Use %s or %s.'=>'e.g. Użyj %s lub %s.','Purge pages by category name - e.g. %2$s should be used for the URL %1$s.'=>'Wyczyść strony używając nazwy kategorii - e.g. %2$s powinno zostać użyte dla adresu URL %1$s.','Notified LiteSpeed Web Server to purge everything.'=>'Powiadomiono serwer LiteSpeed aby wyczyścił wszystko.','Use Primary Site Configuration'=>'Użyj głównych ustawień strony','This will disable the settings page on all subsites.'=>'To wyłączy stronę ustawień na wszystkich podstronach.','Check this option to use the primary site\'s configuration for all subsites.'=>'Zaznacz tę opcję aby użyć ustawień głównej strony na wszystkich podstronach.','Save Changes'=>'Zapisz zmiany','The following options are selected, but are not editable in this settings page.'=>'Poniższe opcje są zaznaczone, ale nie są dostępne do edycji na stronie ustawień.','The network admin selected use primary site configs for all subsites.'=>'Administrator sieci zaznaczył wszystkie ustawienia głównej strony dla wszystkich podstron.','Empty Entire Cache'=>'Opróżnij cały cache','This action should only be used if things are cached incorrectly.'=>'Ta czynność powinna być wykonywana wyłącznie wtedy, gdy cache nie działa prawidłowo.','Clears all cache entries related to this site, <i>including other web applications</i>.'=>'Usuń wszystkie wpisy w pamięci podręcznej dla tej strony, <i>razem z innymi aplikacjami</i>.','This may cause heavy load on the server.'=>'To może spowodować duże obciążenie na Twoim serwerze.','This will clear EVERYTHING inside the cache.'=>'To wyczyści WSZYSTKO w pamięci podręcznej.','LiteSpeed Cache Purge All'=>'Opróżnij cały LiteSpeed Cache','If you would rather not move at litespeed, you can deactivate this plugin.'=>'Jeśli nie chcesz grzebać przy LiteSpeed, możesz wyłączyć tę wtyczkę.','Create a post, make sure the front page is accurate.'=>'Utwórz post, upewnij się, że pierwsza strona jest poprawna.','Visit the site while logged out.'=>'Odwiedź swoją stronę będąc wylogowanym.','Examples of test cases include:'=>'Przykłady przypadków testowych zawierają:','For that reason, please test the site to make sure everything still functions properly.'=>'Z tego powodu, należy przetestować witrynę, aby upewnić się, że wszystko nadal funkcjonuje prawidłowo.','This message indicates that the plugin was installed by the server admin.'=>'To wiadomość informuje o tym, że wtyczka została zainstalowana przed administratora Twojego serwera.','LiteSpeed Cache plugin is installed!'=>'Wtyczka LiteSpeed Cache jest zainstalowana!','Debug Log'=>'Dziennik zdarzeń','Admin IP Only'=>'Tylko Adres IP Administratora','The Admin IP option will only output log messages on requests from admin IPs.'=>'Opcja Admin IP wyświetla tylko wiadomości dziennika na żądania z adresów IP administratora.','Specify how long, in seconds, REST calls are cached.'=>'Określ, jak długo, w sekundach, połączenia REST są buforowane.','The environment report contains detailed information about the WordPress configuration.'=>'Raport środowiska zawiera szczegółowe informacje o konfiguracji WordPress.','Note'=>'Notatka','After verifying that the cache works in general, please test the cart.'=>'Po weryfikacji pamięci podręcznej, sprawdź koszyk.','Purge All On Upgrade'=>'Opróżnij wszystko podczas aktualizacji.','Product Update Interval'=>'Interwał aktualizacji produktu','Determines how changes in product quantity and product stock status affect product pages and their associated category pages.'=>'Określa, jak zmiany ilości produktów i stanu zapasów produktów wpływają na strony produktów i ich powiązane strony kategorii.','Always purge both product and categories on changes to the quantity or stock status.'=>'Zawsze usuwaj zarówno produkt, jak i kategorie w przypadku zmiany ilości lub stanu zapasów.','Do not purge categories on changes to the quantity or stock status.'=>'Nie usuwaj kategorii po zmianie ilości lub stanu zapasów.','Purge product only when the stock status changes.'=>'Wyczyść stronę produktu tylko w przypadku zmiany stanu zapasów.','Purge product and categories only when the stock status changes.'=>'Wyczyść stronę produktu i kategorie tylko po zmianie stanu zapasów.','Purge categories only when stock status changes.'=>'Opróżniaj cache kategorii tylko wtedy, gdy zmieni się dostępość produktu.','Purge product on changes to the quantity or stock status.'=>'Wyczyść produkt w przypadku zmiany ilości lub stanu zapasów.','Htaccess did not match configuration option.'=>'Htaccess nie pasował do opcji konfiguracji.','If this is set to a number less than 30, feeds will not be cached.'=>'Jeśli ten numer jest mniejszy niż 30, kanały nie będą zapisywane w pamięci podręcznej.','Specify how long, in seconds, feeds are cached.'=>'Określ jak długo w sekundach, kanały mają być przechowywane w pamięci podręcznej.','Default Feed TTL'=>'Domyślny TTL kanału informacji','Failed to get %s file contents.'=>'Nie udało się pobrać zawartości pliku %s.','Caching these pages may improve server performance by avoiding unnecessary PHP calls.'=>'Zachowanie tych stron w pamięci podręcznej może zwiększyć wydajność serwera redukując wywołania PHP.','Some themes and plugins add resources via a PHP request.'=>'Niektóre motywy i wtyczki dodają zasoby używając żądań PHP.','Caching this resource may improve server performance by avoiding unnecessary PHP calls.'=>'Zachowanie tych stron w pamięci podręcznej może zwiększyć wydajność serwera redukując wywołania PHP.','favicon.ico is requested on most pages.'=>'favicon.ico jest żądany na większości stron.','Cache favicon.ico'=>'Zapisuj w pamięci podręcznej favicon.ico','Disabling this option may negatively affect performance.'=>'Wyłączenie tej opcji może mieć negatywny wpływ na wydajność.','Invalid login cookie. Invalid characters found.'=>'Niepoprawne ciasteczko logowania. Znaleziono niepoprawne znaki.','WARNING: The .htaccess login cookie and Database login cookie do not match.'=>'UWAGA: Plik cookie logowania .htaccess i plik cookie logowania do bazy danych nie są zgodne.','Invalid login cookie. Please check the %s file.'=>'BŁĄD: Niepoprawne ciasteczko logowania. Sprawdź plik %s','The cache needs to distinguish who is logged into which WordPress site in order to cache correctly.'=>'Pamięć podręczna musi rozróżnić, kto jest zalogowany do witryny WordPress, aby poprawnie zapisywać buforowanie.','There is a WordPress installed for %s.'=>'Na %s jest zainstalowany WordPress.','Example use case:'=>'Przykład użycia:','The cookie set here will be used for this WordPress installation.'=>'Zestaw cookie ustawiony tutaj będzie używany do tej instalacji WordPress.','If every web application uses the same cookie, the server may confuse whether a user is logged in or not.'=>'Jeśli każda aplikacja WWW używa tego samego pliku cookie, serwer może zmylić użytkownika, czy użytkownik jest zalogowany, czy nie.','This setting is useful for those that have multiple web applications for the same domain.'=>'To ustawienie jest przydatne dla tych, którzy mają wiele aplikacji internetowych dla tej samej domeny.','The default login cookie is %s.'=>'Domyślnym ciastkiem logowania jest %s.','MUST BE UNIQUE FROM OTHER WEB APPLICATIONS.'=>'MUSI BYĆ INNE OD INNYCH APLIKACJI SIECIOWYCH.','No spaces and case sensitive.'=>'Bez spacji, rozróżnia wielkość liter.','SYNTAX: alphanumeric and "_".'=>'SYNATX: znaki alfanumeryczne i "_".','Login Cookie'=>'Ciasteczko logowania','More information about the available commands can be found here.'=>'Więcej informacji na temat dostępnych komend możesz znaleść tutaj.','These settings are meant for ADVANCED USERS ONLY.'=>'Te ustawienia będą zrozumiałe dla ZAAWANSOWANYCH UŻYTKOWNIKÓW.','Current %s Contents'=>'Aktualna zawartość: %s','Advanced'=>'Zaawansowane','Advanced Settings'=>'Ustawienia zaawansowane','Purge List'=>'Lista czyszczenia','Purge By...'=>'Wyczyść z...','URL'=>'Adres URL','Tag'=>'Tag','Post ID'=>'Identyfikator wpisu','Category'=>'Kategoria','NOTICE: Database login cookie did not match yo